"use strict"

let p = [5,8,9,"990",10,7,8, "hola", 123, 4, "adios"]

function CreaObjeto(array) {
  let ob1 = {
    Mayores : [],
    Menores : [],
    Otros : []
  }
  for (let i = 0; i < array.length; i++) {
	  console.log("Es de tipo" + typeof array[i]);
		console.log("y su valor es" + array[i]);
		console.log();

    if (array[i] >= 10) {

      ob1.Mayores.push(array[i]);
    }else if (array[i] <= 10) {
      ob1.Menores.push(array[i]);
    } else {
      ob1.Otros.push(array[i]);

    }

  }
  return ob1
}

let k = CreaObjeto(p);
console.log(k);
